import React from "react";
import { Table } from "react-bootstrap";

const Tabel = ({ kandidate }) => {
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>No</th>
            <th>Nama kandidat</th>
            <th>Jumlah Vote</th>
          </tr>
        </thead>
        <tbody>
          {kandidate.map((calon, index) => {
            return index < 3 ? (
              <tr key={index + 1}>
                <td>{index + 1}</td>
                <td>{calon.nama}</td>
                <td>{calon.vote}</td>
              </tr>
            ) : (
              <div></div>
            );
          })}
        </tbody>
      </Table>
    </div>
  );
};

export default Tabel;
